import React from 'react';
import '../App.css';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import logo from '../images/hand-book-logo-illustration-art-background-43965136.webp';

const Home = () => {
  return (
    <div className='home'>
        <img className='homeLogo' src={logo} alt='library logo'/>
        <div className='homeFirstDiv'>
            <h1>WELCOME TO LIBRARY</h1>
            <div className='homeFirstDiv_childFirstDiv'>
            <div className='textfield'><TextField fullWidth label="Email" id="fullWidth" /></div>
            <div className='textfield'><TextField fullWidth label="Password" type='password' id="fullWidth" /></div>
            </div>
            <Button fullWidth className='btn_In' variant="contained">Sign-In</Button>
            <div className='or'><i>OR</i></div>
            <p></p>
            {/* <Button fullWidth className='btn_Up' variant="contained">Sign-Up</Button> */}
        </div>
    </div>
  )
}

export default Home
